response.about:
Ломаю стереотипы.

"...Все читали на моем лице признаки дурных чувств, которых не было; но их предполагали - и они родились.
Я был скромен - меня обвиняли в лукавстве: я стал скрытен. Я глубоко чувствовал добро и зло;
Никто меня не ласкал, все оскорбляли: я стал
злопамятен;
Я был готов любить весь мир, - меня никто не понял: и я выучился ненавидеть.
Моя бесцветная молодость протекала в борьбе с собой и светом;
Лучшие мои чувства, боясь насмешки, я хоронил в глубине сердца: они там и умерли. Я говорил правду -мне не верили: я начал обманывать;..."
